import React from "react";

import { Routes, Route } from "react-router-dom";
import pages from "../Pages/index";
import { ThemeProvider, createTheme, palette } from "@mui/system";
// import "../../index.css";

const theme = createTheme({
  palette: {
    colors: {
      primary: "#1C1C1C",
      secondary: "#B8B8B8",
    },
    background: {
      paper: "#fff",
    },
    text: {
      primary: "#1C1C1C",
      secondary: "#B8B8B8",
    },
    action: {
      active: "#001E3C",
    },
    success: {
      dark: "#009688",
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <Routes>
          <Route path="/" exact element={pages.intro()} />
          <Route path="/contact" exact element={pages.contact()} />
          <Route
            path="/financial_information"
            exact
            element={pages.financial()}
          />
          <Route
            path="/business_information"
            exact
            element={pages.business()}
          />
          <Route path="/policies" exact element={pages.policies()} />
          <Route path="*" element={pages.intro()} />
        </Routes>
      </div>
    </ThemeProvider>
  );
}

export default App;
